import React from "react";
import styled from "styled-components";
import { getImageUrl } from "../utils";

// import {getImageUrl} from "../../utils"

const Container = styled.div`
  background-color: black;
  height: 100vh;
`;

const CardContainer = styled.div`
  display: grid;
  place-items: center;
  padding-top: 50px;

  &:before {
    width: 100px;
    height: 100px;
    content: "";
    position: absolute;
    background-color: rgb(144, 161, 255);
    z-index: -1;
    border-radius: 50%;
    left: 100px;
    top: 50px;
    transition: all 1s;
  }

  &:hover:before {
    transform: translate(-50px, 50px);
  }
`;

const Card = styled.div`
  position: relative;
  width: 320px;
  height: 350px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  padding: 20px 10px;
  border-radius: 10px;
  backdrop-filter: blur(30px);
  background-color: rgba(65, 65, 65, 0.308);
  border: 1px solid rgba(255, 255, 255, 0.089);
  cursor: pointer;
`;

const City = styled.p`
  font-weight: 700;
  font-size: 2rem;
  letter-spacing: 1.2px;
  color: white;
`;

const Weather = styled.p`
  font-weight: 500;
  font-size: 1rem;
  letter-spacing: 1.2px;
  color: rgb(197, 197, 197);
`;

const Temperature = styled.p`
  font-size: 2rem;
  color: white;
`;

const MinMaxContainer = styled.div`
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const MinMax = styled.div`
  width: 50%;
  display: flex;
  flex-direction: column;
  align-items: ${(props) => (props.isMax ? "flex-start" : "flex-end")};
  justify-content: center;
  padding: 0px 20px;
  gap: 4px;
`;

const Heading = styled.p`
  font-size: 1.5em;
  font-weight: 600;
  color: white;
`;

const Temp = styled.p`
  font-size: 0.9rem;
  font-weight: 500;
  color: rgb(197, 197, 197);
`;

const Image = styled.img`
    max-width: 100%;
  height: auto;
`;

const Main = ({ weatherData }) => {
  console.log(weatherData);

  const imageSource = getImageUrl("image.png");

  return (
    <div>
      {weatherData ? (
        <Container>
          <CardContainer>
            <Card>
              <City>{weatherData.name}</City>
              <Weather>{weatherData.weather[0].description}</Weather>
              <svg
                version="1.1"
                id="Layer_1"
                x="0px"
                y="0px"
                width="50px"
                height="50px"
                viewBox="0 0 100 100"
                xmlSpace="preserve"
              >
                <image id="image0" width="100" height="100" x="0" y="0"></image>
              </svg>
              <Temperature>{weatherData.main.temp}°C</Temperature>
              <MinMaxContainer>
                <MinMax isMax>
                  <Heading>Max</Heading>
                  <Temp>{weatherData.main.temp_min}°</Temp>
                </MinMax>
                <MinMax>
                  <Heading>Min</Heading>
                  <Temp>{weatherData.main.temp_max}°</Temp>
                </MinMax>
              </MinMaxContainer>
            </Card>
          </CardContainer>
        </Container>
      ) : (
        <div>
          <Container>
            <CardContainer>
              <Card>
                <City>PINK CITY</City>
                <Weather>PARTILY CLOUDY</Weather>
                <Image src={im} />


                {/* <image id="image0" width="100" height="100" x="0" y="0" href={getImageUrl("weather.png")}></image> */}
                <Temperature>32°</Temperature>
                <MinMaxContainer>
                  <MinMax isMax>
                    <Heading>Max</Heading>
                    <Temp>32°</Temp>
                  </MinMax>
                  <MinMax>
                    <Heading>Min</Heading>
                    <Temp>30°</Temp>
                  </MinMax>
                </MinMaxContainer>
              </Card>
            </CardContainer>
          </Container>

        </div>
      )}
    </div>
  );
};

export default Main;
